import img1 from "../assets/aa.jpg"
import img2 from "../assets/bb.jpg"
import img3 from "../assets/cc.jpg"
import img4 from "../assets/dd.jpg"


const DUMMY_PROFILES = [
  { id: 1, name: 'Sophia', role: 'Model', location: 'Paris', price: 300, img: img1 },
  { id: 2, name: 'Isabella', role: 'Dancer', location: 'Madrid', price: 350, img: img2 },
  { id: 3, name: 'Emma', role: 'Student', location: 'Berlin', price: 250, img: img3 },
  { id: 4, name: 'Olivia', role: 'Actress', location: 'Milan', price: 400, img: img4 }
];

export default DUMMY_PROFILES;
